import React, { Component } from "react";
import User from "./user";

class Users extends Component {
  state = [
    { name: "John", age: 20 },
    { name: "Nick", age: 20 },
    { name: "Mark", age: 20 }
  ];
  render() {
    return (
      <div>
        <h1>{this.props.title}</h1>
        <User age={this.state.age[0]}>{this.state.name[0]}</User>
        <User age={this.state.age[1]}>{this.state.name[1]}</User>
        <User age={this.state.age[2]}>{this.state.name[2]}</User>
      </div>
    );
  }
}

export default Users;
